//import React from "react"
//import "..style/Navigation.css"

function Navigation(){
    return(

        <ul className="nav_container">
            <li>Home</li>
            <li>About</li>
            <li>Dropdown</li>
            <li>Portfolio</li>
            <li>Services</li>
            <li>Resume</li>
            <li>Blog</li>
            <li>Contact</li>

        </ul>
    )
}
export default Navigation;
